class LoginPage extends React.Component(){
    render(){
        return(
            <div>
                <form id="login">
                    Username<br />
                    <input type={"text"} />
                    <br />Password<br />
                    <input type={"password"} />
                    <br /><button label={"Entra"} />
                </form>
            </div>
        )
    }
}

export default LoginPage;
